import './App.css';

function ScriptChart() {
  return (
    <div className="App">
      <div>{/* Kana type */}
        <input type="checkbox" id="hiragana" name="hiragana" value="Hiragana"/>
        <label>Hiragana</label>
        <input type="checkbox" id="katakana" name="katakana" value="Katakana"/>
        <label>Katakana</label>
      </div>
    </div>
  );
}

export default ScriptChart;
